import { Component } from 'react';
import {
  Button,
  Form,
  FormGroup,
  Input,
  Label
} from 'reactstrap';


class CreateInstance extends Component {
  render() {
    return (
      <div className="App">
        <h2>Create New Instance</h2>
        <Form className="form">
          <FormGroup>
            <Label for="InstanceName">Name</Label>
            <Input
              type="text"
              name="name"
              id="exampleName"
              placeholder="NDLT Archive"
            />
          </FormGroup>

        <Button>Create</Button>
      </Form>
    </div>
  );
}
}
export default CreateInstance;
